import logo from './logo.svg';
import './App.css';
import { useState } from 'react';

function Counter() {
    let count = 0
    const andre = function(){
      count++
    }

    return (
      <>

      <div>
        <button onClick={andre}>+</button>
        <span>{count}</span>
      </div>
      </>
    );
}



export default Counter;
